;; gorilla-repl.fileformat = 1

;; **
;;; # Regression test score
;;; 
;;; A score function to test the evolutionary algorithm side of the hybrid polynomial search.
;; **

;; @@
(ns regression-test-score
  (:require [gorilla-plot.core :as plot]
            [incanter.stats :as stats]
            ))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Some helper functions ... should make a libary at some point I suppose.
;; **

;; @@
(defn outer [xs ys] (vec (apply concat (mapv (fn [x] (mapv (fn [y] [x y]) ys)) xs))))

(defn transpose [m] (apply mapv vector m))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;regression-test-score/transpose</span>","value":"#'regression-test-score/transpose"}
;; <=

;; @@
(outer [1 2 3] [1 2 3])
(transpose (outer [1 2 3] [1 2 3]))


;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-vector'>[</span>","close":"<span class='clj-vector'>]</span>","separator":" ","items":[{"type":"list-like","open":"<span class='clj-vector'>[</span>","close":"<span class='clj-vector'>]</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-long'>1</span>","value":"1"},{"type":"html","content":"<span class='clj-long'>1</span>","value":"1"},{"type":"html","content":"<span class='clj-long'>1</span>","value":"1"},{"type":"html","content":"<span class='clj-long'>2</span>","value":"2"},{"type":"html","content":"<span class='clj-long'>2</span>","value":"2"},{"type":"html","content":"<span class='clj-long'>2</span>","value":"2"},{"type":"html","content":"<span class='clj-long'>3</span>","value":"3"},{"type":"html","content":"<span class='clj-long'>3</span>","value":"3"},{"type":"html","content":"<span class='clj-long'>3</span>","value":"3"}],"value":"[1 1 1 2 2 2 3 3 3]"},{"type":"list-like","open":"<span class='clj-vector'>[</span>","close":"<span class='clj-vector'>]</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-long'>1</span>","value":"1"},{"type":"html","content":"<span class='clj-long'>2</span>","value":"2"},{"type":"html","content":"<span class='clj-long'>3</span>","value":"3"},{"type":"html","content":"<span class='clj-long'>1</span>","value":"1"},{"type":"html","content":"<span class='clj-long'>2</span>","value":"2"},{"type":"html","content":"<span class='clj-long'>3</span>","value":"3"},{"type":"html","content":"<span class='clj-long'>1</span>","value":"1"},{"type":"html","content":"<span class='clj-long'>2</span>","value":"2"},{"type":"html","content":"<span class='clj-long'>3</span>","value":"3"}],"value":"[1 2 3 1 2 3 1 2 3]"}],"value":"[[1 1 1 2 2 2 3 3 3] [1 2 3 1 2 3 1 2 3]]"}
